import React, { Component } from 'react';
import Footer from '../../components/Footer/Footer';
import sekcijaKontakt from '../../sections/sectionsKontakt/sekcijaKontakt';

export default class Kontakt extends Component {
	render() {
		return (
			<React.Fragment>
				<sekcijaKontakt />
				<Footer />
			</React.Fragment>
		);
	}
}
